angular.module('ui.slimscroll', []).directive('slimscroll', function () {
  'use strict';

  return {
    restrict: 'A',
    link: function ($scope, $elem, $attr) {
      var off = [];
      var option = {};
      
      var refresh = function () {		
         if ($attr.slimscroll) {		         
           option = $scope.$eval($attr.slimscroll);		           
         } else if ($attr.slimscrollOption) {		        
           option = $scope.$eval($attr.slimscrollOption);		           
         }
         
        $($elem).slimScroll({ destroy: true });		        

         $($elem).slimScroll(option);		         
      };
      
      var registerWatch = function () {
        if ($attr.slimscroll && !option.noWatch) {
          off.push($scope.$watchCollection($attr.slimscroll, refresh));
        }

        if ($attr.slimscrollWatch) {
          off.push($scope.$watchCollection($attr.slimscrollWatch, refresh));
        }

        if ($attr.slimscrolllistento) {
          off.push($scope.$on($attr.slimscrolllistento, refresh));
        }
      };

      var destructor = function () {
        $($elem).slimScroll({ destroy: true });
        off.forEach(function (unbind) {
          unbind();
        });
        off = null;
      };

      off.push($scope.$on('$destroy', destructor));
      
      registerWatch();
    }
  };
});

var app = angular.module('TieApp', []);

app.controller('TieEcoCtrl', function ($scope, $http, $injector) {
    $scope.newWindow = function (url, name, width, height) {
        var leftPosition, topPosition;

        leftPosition = (window.screen.width / 2) - ((width / 2) + 10);
        topPosition = (window.screen.height / 2) - ((height / 2) + 50);

        window.open(url, name, "height=" + height + ",width=" + width + ",resizable=yes,left="
            + leftPosition + ",top=" + topPosition + ",screenX=" + leftPosition + ",screenY="
            + topPosition + "scrollbars=yes");
    };
    
    $scope.openModal = function(type) {
        if ($injector.has('$uibModal')) {
            switch (type) {
                case 'logintoseemorepages':
                    var modalInstance = $injector.get('$uibModal').open({
                        animation: true,
                        templateUrl: '/angular/modules/project/common/templates/public/message_modal.html',
                        controller: function ($modalInstance) {
                            $scope.ok = function() {
                                $modalInstance.dismiss('cancel');
                            };
                        },
                        resolve: {

                        }
                    });
                    break;
                
                default:
            }
        }
        else {
      
        }
    };
});

app.controller('HeaderCtrl', function ($scope, $http) {

    $scope.openModalJoinUs = function () {
        $scope.$emit('showModalJoinUs');
    };
});

app.controller('JoinUsCtrl', function ($scope, $rootScope, $http, $location, $window) {
    $scope.optionSelected = null;
    $scope.cookieName = 'answer_join_us';
    $scope.options = [
        {
            key: 1,
            value: 'I am a TiE Silicon Valley member, TiEcon attendee, or part of another TiE Chapter.'
        },
        {
            key: 2,
            value: 'I am currently not part of TiE but I am a tech.'
        }
    ];

    //$rootScope.$on('showModalJoinUs', function(event) {
    //    $scope.openPopUp();
    //});
    //
    //$scope.openPopUp = function(){
    //    Custombox.open({
    //        target: '#show-profile',
    //        effect: 'fadein',
    //        width: "700"
    //    });
    //};

    $scope.openLinkedin = function () {
        if ($scope.optionSelected) {

            var url = Routing.generate('hwi_oauth_service_redirect', {
                'service': 'linkedin',
                '_destination': '/join/' + $scope.optionSelected.key
            });

            var cvalue = {
                'answer_join_us': {
                    key: $scope.optionSelected.key,
                    value: $scope.optionSelected.value
                }
            };

            $scope.saveInCookie($scope.cookieName, JSON.stringify(cvalue), 100);

            $window.location.href = url;
        }
    };

    $scope.saveInCookie = function (cname, cvalue, exdays) {
        var d = new Date();
        d.setTime(d.getTime() + (exdays * 24 * 60 * 60 * 1000));
        var expires = "expires=" + d.toUTCString();
        document.cookie = cname + "=" + cvalue + "; " + expires;
    };

    $scope.readFromCookie = function () {
        var value = "; " + document.cookie;
        var parts = value.split("; " + $scope.cookieName + "=");
        if (parts.length == 2) {
            var optionSelected = JSON.parse(parts.pop().split(";").shift());
            if (optionSelected && optionSelected.answer_join_us) {
                $scope.optionSelected = optionSelected.answer_join_us;
                //console.log($scope.optionSelected);
            }

        }
    };

    $scope.setOptionSelected = function (option) {
        $scope.optionSelected = option;
    };

    $scope.readFromCookie();
});

