app.controller('ActivateAccountCtrl', function ($scope, $http, $timeout, $window) {
    $scope.requestUrl = '/';
    $scope.isDisabledSave = false;
    $scope.type = null;
    $scope.init = function (type) {
        if (type == 'verify_user') {
            $scope.requestUrl = Routing.generate('tieeco_public_verify_password_temp');
        } else {
            $scope.requestUrl = Routing.generate('tieeco_public_user_login_link');
        }

        $scope.type = type;
        console.log($scope.type);
    };

    $scope.ok = function () {
        var data = $("#loginLink").serialize();
        $scope.isDisabledSave = true;

        GiaBPLoader.show();
        $http({
                method: 'POST',
                url: $scope.requestUrl,
                data: data,
                //headers: {
                //    'Content-Type': ' application/json'
                //},
                headers: {'Content-Type': 'application/x-www-form-urlencoded'},
            }
        ).
            success(function (data, status, headers, config) {
                toastr.success('Operation successful!');

                $timeout(function () {
                    var redirectTo = '/';

                    if ($scope.type == 'verify_user') {
                        redirectTo = Routing.generate('vipprofile_new');
                    } else {
                        redirectTo = Routing.generate('tieeco_public_user_edit_myprofile');
                    }

                    $window.location.href = redirectTo;
                }, 2000);
            }).
            error(function (data, status, headers, config) {
                if (data && data.error) {
                    toastr.error(data.error[0]);
                } else {
                    toastr.error('An error has occurred!');

                }

            }).finally(function () {
                $scope.isDisabledSave = false;
                GiaBPLoader.hide();

            });
    };

    $scope.isVisibleFormLoginWithoutLinkedin = false;
    $scope.showFormOrRedirect = function (loginLink) {
        if (loginLink) {
            var redirectTo = Routing.generate('vipprofile_new');
            $window.location.href = redirectTo;
        } else {
            $scope.isVisibleFormLoginWithoutLinkedin = !$scope.isVisibleFormLoginWithoutLinkedin;
        }
    }
});

