app.controller('FormEditCtrl', function ($scope, $http, $timeout, $window) {
    $scope.requestUrl = '/';
    $scope.isDisabledSave = false;
    $scope.nameCtrl = null;
    //$scope.data = null;

    $scope.init = function (nameCtrl) {
        $scope.nameCtrl = nameCtrl;
        $scope.createRequestUrl();
    };

    $scope.ok = function () {
        $scope.isDisabledSave = true;
        $http({
                method: 'POST',
                url: $scope.requestUrl,
                data: $scope.createData(),
                //headers: {
                //    'Content-Type': ' application/json'
                //},
                headers: {'Content-Type': 'application/x-www-form-urlencoded'},
            }
        ).
            success(function (data, status, headers, config) {
                toastr.success('Operation successful!');

            }).
            error(function (data, status, headers, config) {
                if (data && data.error) {
                    toastr.error(data.error[0]);
                } else {
                    toastr.error('An error has occurred!');

                }

            }).finally(function () {
                $scope.isDisabledSave = false;
            });

    };

    $scope.createRequestUrl = function () {
        switch ($scope.nameCtrl) {
            case 'emailctrl':
                $scope.requestUrl = Routing.generate('app_user_edit_email');
                break;
            case 'passwordctrl':
                $scope.requestUrl = Routing.generate('app_user_edit_password');
                break;
        }
    };

    $scope.createData = function () {
        var data = null;
        switch ($scope.nameCtrl) {
            case 'emailctrl':
                $scope.requestUrl = Routing.generate('app_user_edit_email');
                data = $("#emailform").serialize();
                break;
            case 'passwordctrl':
                $scope.requestUrl = Routing.generate('app_user_edit_password');
                data = $("#passwordform").serialize();
                break;
        }

        return data;
    };
});


